INSERT INTO "MYCURD"."SYS_NOTE" VALUES ('1', 'very good morning hello world 牛逼', 'html', '<p> 站在2018年的年末222</p><p>回望从1978年以来2<img src="/static/plugins/simditor-2.3.23/emoji/image/broken_heart.png" width="20" height="20" alt="broken_heart" data-emoji="true" data-non-image="true"></p><p> 一起走过的那些日子222</p><p> 许多人心潮澎湃2222222</p><p>这40年，改变了人们对未来的想象</p><p> <mark>这40年，让人们相信奋斗能够改变命运<img src="/static/plugins/simditor-2.3.23/emoji/image/wink.png" width="20" height="20" alt="wink" data-emoji="true" data-non-image="true"></mark></p><p><img alt="" src="http://news.youth.cn/gn/201812/W020181229483214124505.gif"></p><p>伟大的成就</p><p>伟大的巨变</p><p>为实现中华民族伟大复兴的中国梦</p><p>每一个铁路建设者</p><p>都曾不懈努力顽强拼搏</p><p><img alt="" src="http://news.youth.cn/gn/201812/W020181229483214237941.gif"></p><p>集中精力打歼灭战</p><p>三年铺通京九铁路</p><p>不论在什么时代</p><p>集中力量攻坚克难</p><p>都是中国人建设家园的制胜法宝</p><p><img alt="" src="http://news.youth.cn/gn/201812/W020181229483214378159.gif"></p><p>京九铁路全长2400多公里</p><p>贯穿大别山、井冈山、瑞金等革命老区</p><p>1996年京九铁路如期通车</p><p>沿线2亿人直接受益</p>', '0', '00', '522465144505106432', TO_DATE('2018-12-31 10:21:38', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "MYCURD"."SYS_NOTE" VALUES ('529774891788926976', 'good morning hello world', NULL, '<p><img alt="Image" src="/static/image/favicon.ico" width="72" height="72"><br></p><table><colgroup><col width="16.636029411764707%"><col width="16.636029411764707%"><col width="16.636029411764707%"><col width="16.636029411764707%"><col width="16.727941176470587%"><col width="16.727941176470587%"></colgroup><thead><tr><th><br></th><th><br></th><th><br></th><th><br></th><th><br></th><th><br></th></tr></thead><tbody><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table><p><b>heloow rold good morning&nbsp;</b></p>', '0', NULL, '522465144505106432', TO_DATE('2019-01-01 21:37:33', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "MYCURD"."SYS_NOTE" VALUES ('528593810750439424', 'Java 自定义注解2', NULL, '<h1>Download</h1><p><img src="/static/plugins/simditor-2.3.23/emoji/image/heart.png" width="20" height="20" alt="heart" data-emoji="true" data-non-image="true"><br></p><p>Click&nbsp;<a href="https://github.com/mycolorway/simditor/releases">Here</a>&nbsp;to download the zip file. You can also install Simditor by bower and npm :</p><ul> <li><code>$ npm install simditor</code></li> <li><code>$ bower install simditor</code></li></ul><p>Import files below into your web applicatio</p><pre><code class="lang-js">function good(){ console.log(''good morning''); alert(1+1); }</code></pre><p>Note that</p><ul> <li>Simditor is based on&nbsp;<a href="http://jquery.com/">jQuery</a>&nbsp;and&nbsp;<a href="https://github.com/mycolorway/simple-module">module.js</a>.</li> <li><a href="https://github.com/mycolorway/simple-hotkeys">hotkeys.js</a>&nbsp;is used to bind hotkeys.</li> <li><a href="https://github.com/mycolorway/simple-uploader">uploader.js</a>&nbsp;is related to uploading files. You don''t need to import this file if you don''t want the uploading feature</li></ul><p><br></p><table><colgroup><col width="25%"><col width="25%"><col width="25%"><col width="25%"></colgroup><thead><tr><th>1</th><th>3</th><th>3</th><th>3</th></tr></thead><tbody><tr><td>2是解放拉萨解放</td><td>33及数量大幅减少了</td><td>3士大夫艰苦拉萨解放</td><td>3节省了空间分开了</td></tr><tr><td>3上帝就发洛杉矶</td><td>3撒旦发射点立刻反击</td><td>3送到房间里</td><td>3士大夫立刻就圣诞节</td></tr></tbody></table>', '527520434854297600', NULL, '522465144505106432', TO_DATE('2019-01-01 22:12:37', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "MYCURD"."SYS_NOTE" VALUES ('528594058168238080', '饥荒无标题笔记2', NULL, '<p> 可用Ctrl+F查询所需物品名称（大部分代码名称已修改成联机中文MOD翻译）。</p><p> 进入游戏后按“～”键调出控制台</p><p> 输入c_give("代码名称“，数量）——物品会按所输数量出现在物品栏，假若包裹放不下，会自动掉落在地上。此代码最方便，甚至还可以在鼠标指针处直接放置建筑类物品。</p><p> c_spawn(“XX”，数量)——放鼠标指针指示的地上</p><p> 上帝模式：c_godmode()</p><p> 饥饿值上限：GetPlayer().components.hunger:SetMax(500)</p><p> 精神值上限：GetPlayer().components.sanity:SetMax(500)</p><p> 生命值上限：GetPlayer().components.health:SetMaxHealth(300)</p><p> 全物品直接制造：GetPlayer().components.builder:GiveAllRecipes()</p><p> 删除物品：TheInput:GetWorldEntityUnderMouse():Remove()</p><p> 传送：GetPlayer().Transform:SetPosition(坐标，例：0,0,0)</p><p> 此列表已剔除一些对于联机无效的代码，测试过真实有效。</p><p><font><strong>材料</strong></font></p><p> 割下的草：cutgrass</p><p> 树枝：twigs</p><p> 木头：log</p><p> 木炭：charcoal</p><p> 灰：ash</p><p> 采集的芦苇：cutreeds</p><p> 花瓣：petals</p><p> 噩梦花瓣：petals_evil</p><p> 活木头：livinglog</p><p> 叶子：foliage</p><p> 荧光果：lightbulb</p><p> 发光浆果：wormlight</p><p> 冰：ice</p><p> 燧石：flint</p><p> 硝石：nitre</p><p> 岩石：rocks</p><p> 大理石：marble</p><p> 月之石：moonrocknugget</p><p> 黄金：goldnugget</p><p> 铥矿石：thulecite</p><p> 铥矿石碎片：thulecite_pieces</p><p> 红宝石：redgem</p><p> 蓝宝石：bluegem</p><p> 紫宝石：purplegem</p><p> 绿宝石：greengem</p><p> 橙宝石：orangegem</p><p> 黄宝石：yellowgem</p><p> 彩色宝石：opalpreciousgem</p><p> 绳子：rope</p><p> 木板：boards</p><p> 石砖：cutstone</p><p> 莎草纸：papyrus</p><p> 噩梦燃料：nightmarefuel</p><p> 蜂蜡：beeswax</p><p> 蜡纸：waxpaper</p><p> 电器元件：transistor</p><p> 狗牙：houndstooth</p><p> 蜘蛛丝：silk</p><p> 蜘蛛腺体：spidergland</p><p> 胡子：beardhair</p><p> 牛毛：beefalowool</p><p> 牛角：horn</p><p> 便便：poop</p><p> 蜂巢：honeycomb</p><p> 蜂刺：stinger</p><p> 猪皮：pigskin</p><p> 兔人尾巴：manrabbit_tail</p><p> 猫尾：coontail</p><p> 海象牙：walrus_tusk</p><p> 胡须：beardhair</p><p> 烂鸡蛋：rottenegg</p><p> 乌鸦羽毛：feather_crow</p><p> 红雀羽毛：feather_robin</p><p> 雪雀羽毛：feather_robin_winter</p><p> 金丝雀羽毛：feather_canary</p><p> 鸟粪：guano</p><p> 触手皮：tentaclespots</p><p> 粘滑含糊虫（黏糊虫粘液）：slurtleslime</p><p> 破碎的背壳：slurtle_shellpieces</p><p> 蚊子血袋：mosquitosack</p><p> 缀食者皮：slurper_pelt</p><p> 远古守护者角：minotaurhorn</p><p> 掉落的羽毛：goose_feather</p><p> 鳞片：dragon_scales</p><p> 厚皮毛：bearger_fur</p><p> 巨鹿眼球：deerclops_eyeball</p><p> 毒蕈皮：shroom_skin</p><p> 闪电羊角：lightninggoathorn</p><p> 格罗门翅膀：glommerwings</p><p> 格罗门花（花瞬间死亡）：glommerflower</p><p> 格罗门燃料：glommerfuel</p><p> 冷冻虫卵：lavae_cocoon</p><p> 暗影之心：shadowheart</p><p> 鹿茸：deer_antler</p><p> 克劳斯钥匙：klaussackkey</p><p> 齿轮：gears</p><p> 骨片：boneshard</p><p> 化石碎片（据说多种实际上只出一种）：fossil_piece</p>', '0', NULL, '522465144505106432', TO_DATE('2018-12-29 15:30:36', 'SYYYY-MM-DD HH24:MI:SS'));
INSERT INTO "MYCURD"."SYS_NOTE" VALUES ('528615933434920960', '测试代码笔记牛逼', NULL, '<p>good mornin</p><table><colgroup><col width="25%"><col width="25%"><col width="25%"><col width="25%"></colgroup><thead><tr><th><br></th><th><br></th><th><br></th><th><br></th></tr></thead><tbody><tr><td>public void addNoteAction(){<br>    String cateId = getPara("cateId","0");    SysNote sysNote = new SysNote();    sysNote.setId(IdUtils.id())<br>            .setTitle("无标题笔记")<br>            .setCateId(cateId)<br>            .setUserId(WebUtils.getSysUser(this).getId())<br>            .setCreateTime(new Date());    if(sysNote.save()){<br>        renderSuccess(Constant.ADD_SUCCESS);    }else{<br>        renderFail(Constant.ADD_FAIL);    }<br>}<br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table>', '527520434854297600', NULL, '522465144505106432', TO_DATE('2019-01-01 23:12:59', 'SYYYY-MM-DD HH24:MI:SS'));
